import axios from "axios";

const apikey = process.env.REACT_APP_APIKEY
const baseurl = process.env.REACT_APP_BASEURL

export const getPhotosList = async() => {
    const photo = await axios.get(`${baseurl}?key=${apikey}&q=yellow+flowers&image_type=photo`)
    return photo.data
}

export const searchPhotos = async(q) => {
    const search = await axios.get(`${baseurl}?search=query=${q}&api_key=${apikey}`)
    return search.data
}
